import React, { FunctionComponent } from 'react';
import {Modal} from "antd";
import useAppStore from "../hooks/useAppStore";
import {useDispatch} from "react-redux";
import {toggleAboutCommand} from "../../redux/commands/ToggleAboutCommand";
interface Props {}

declare var COMMITHASH : string;
declare var VERSION: string;

const AboutPage: FunctionComponent<Props> = (props) => {
    const state = useAppStore();
    const dispatch = useDispatch();
    const hide = () => {
        dispatch(new toggleAboutCommand(false));
    };

    return <Modal width={300} wrapClassName='about-page' visible={!!state.showAbout} onCancel={hide} footer={null}>
        {/*// image from electron/Grace.ico*/}
        <img width={50} src={'data:image/x-icon;base64,'} />
        <a href='https://grace-note.app' onClick={e => {
            e.stopPropagation();
            e.preventDefault();
            open('https://grace-note.app');
        }} className='app-name'>
            Grace Note
        </a>
        <div>Version: {VERSION}</div>
        <div>Commit: {COMMITHASH}</div>
    </Modal>;
};

export default AboutPage;
